 import {Link} from 'react-router-dom';

const Navigation = () => {
  return (
    <>
        <div className='navbar flex justify-between'>
            <img className='logo h-8' src='../images/logo.png'></img>

            <ul className='navtool flex pl-7'>
            <Link to="/">HOME</Link>
            <Link to="/about">ABOUT</Link>
            <Link to="/cart"><div className='cartbg bg-orange-500 p-2'><img className='cart h-4 inline-block' src='../images/cart.png'></img></div></Link>
            </ul>

        </div>
    </>
  )
}

export default Navigation
